import { Component, OnInit, Query } from '@angular/core';
import { Router } from '@angular/router';
import { Observable } from 'rxjs';
import * as jsPDF from 'jspdf';
import { Reservations } from 'src/app/reservations';
import { ReservationsService } from 'src/app/reservations.service';
import { formatDate } from '@angular/common';


@Component({
  selector: 'app-reservationsreport-list',
  templateUrl: './reservationsreport-list.component.html',
  styleUrls: ['./reservationsreport-list.component.scss']
})
export class ReservationsreportListComponent implements OnInit {
  reservations: Observable<Reservations[]>;
  alertDisable = true;
  alertDisables = true;
  alertMessage = "null";
  alertMessages = "null";
  data1 = [];
  head = [['Id ReservaciÃ³n', 'Lugar', 'Residente', '# Residencia', 'Fecha inicio', 'Fecha fin','Fraccionamiento']];


  constructor(private reservationService: ReservationsService,
    private router: Router) { }
      filterPost = '';
        ngOnInit(): void {
          this.reloadData();
          // this.reloadData();
        }
  
  reloadData() {
    
    this.reservationService.getReservationReport().subscribe(
      data => {
        this.reservations = this.reservationService.getReservationReport();
        let nombre;
        for (let key in data) {
          var dats = data[key];
          nombre = dats['tenants_name']||dats['tenants_father_surname']||dats['tenants_mother_surname'];
          console.log(dats);
          this.data1.push(
            [dats['reservations_id'], dats['articles_name_article'],nombre, dats['tenants_residential_number'],dats['reservations_start'],dats['reservations_end'],dats['tenants_fractionation_unit']]);
        }
      },
      error => {
        console.log(error);   
        let coins = [];
        for (let key in error) {
          this.alertDisable = false;
          this.alertMessage = error['statusText'];          
        }
      });

      
  }


  getReservationReport(){
    this.router.navigate(['reservationsreport-list']);
  }


  generate() 
  { 
   
    //La receta
   let now = new Date();
   var doc = new jsPDF();

   doc.setFontSize(11);
   doc.text('Reporte de reservaciones', 82, 21);
   doc.text('Fecha de Ejecucion:' +formatDate(now, 'dd-MM-yyyy', 'en-US', '+0530') , 79, 29);
   doc.setTextColor(100);
   

   var base64Img = 'data:image/jpeg;base64,';
   doc.addImage(base64Img, 'JPEG', 160, 2, 45, 45);

   (doc as any).autoTable({
     head: this.head,
     body: this.data1,
     theme: 'striped',
     startY: 40,

     headerStyles: {
      //columnWidth: 'wrap',
      cellPadding: 2,
      lineWidth: 0,
      valign:'top',
      fontStyle: 'bold',
       halign: 'center',    //'center' or 'right'
      fillColor: [0,0,102],
      //textColor: [78, 53, 73], //Black     
      textColor: [255, 255, 255], //White     
      fontSize: 8,
      rowHeight:10
  },
     styles: { halign: 'center'},

     columnStyles: {  halign: 'center',
     fontStyle: 'bold',
     fontSize: 8
    },

    
    
     didDrawCell: data => {
       console.log(data.column.index)
     }
   })

   // Open PDF document in new tab
   doc.output('dataurlnewwindow')

   // Download PDF document  
   doc.save('Reservaciones.pdf');
} 

  query(ref,value:boolean){
  if (value)
  return ref.where('status','=',1);
  else
  return ref.where('status','=',1);
  }


}


